import React from "react";
import "./uploadInput.css";

class UploadInput extends React.Component {
  render() {
    return (
      <div className="col-3">
        <input
          type="file"
          id="input-file-now-custom-2"
          class="file-upload"
          data-max-file-size="2M"
        />
      </div>
    );
  }
}

export default UploadInput;
